- input: "TEXT\x1CC00330647\x1C.TEXT\x1C\x1CF3XA\x1CIn response to your letter dated
    April 2, 2008, we have filed an amended 2007 Year End Report that clarifies the
    concerns outlined in the letter.  The September 5, 2007 contribution to FRIENDS
    OF SENATOR JAY ROCKEFELLER in the amount of $2500 was redesignated to the general
    election on September 26, 2007.  A hard copy of the letter of confirmation sent
    to this campaign directing this redesignation will be provided via postal mail
    to Kristin DeCarmine at the FEC.  The beginning cash balance has been reconciled
    with the ending cash balance on the Amended Mid-Year Report.  The discrepancy
    arose from a clerical error where the cash balance amount was entered and aggregated
    multiple times.  All required information for individuals contributing in excess
    of $200 in a calendar year has been collected and supplied for this report."
